INSERT INTO `pages` VALUES (1,'Home','home','<h1><strong><span style=\"color: #000080;\"><a style=\"color: #000080;\" title=\"Portal\" href=\"http://www.lter.ro/portal\">RISE PORTAL</a></span></strong></h1>',1,'2020-01-20 06:48:00','2020-01-22 05:35:08'),(2,'About','about','<p style=\"margin: 0px; padding: 0px; color: #333333; font-family: Helvetica, Tahoma, Verdana, sans-serif; text-align: center;\">Ecosystems are providing essential services to humans. Food production, drinkable water, clean air, biodiversity support, climate regulation and nutrient cycling, mitigation of natural disasters, regulation of pests and diseases are just a few examples of ecosystem services of vital importance.<br /><br /></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #333333; font-family: Helvetica, Tahoma, Verdana, sans-serif; text-align: center;\"><strong style=\"background-color: transparent;\">RISE (<span style=\"font-size: 12pt; font-family: Calibri, sans-serif;\">Integrated platform for land/water monitoring based on remote and in situ measurements)</span></strong><span style=\"background-color: transparent;\"> project makes significant progress beyond the state-of-the-art through the development of an integrated platform for aquatic and terrestrial ecosystems studies. The platform integrates in-situ measurements (from automated sensors and monitoring programs) with Earth Observation &ndash; EO image analysis to provide data quality services to multiple applications.<br /><br /></span></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #333333; font-family: Helvetica, Tahoma, Verdana, sans-serif; text-align: center;\">The platform is an example of a highly instrumented site and should also act as a prototype for a nationally distributed monitoring network to support transparent and knowledge-based conservation and management policies.</p>\r\n<p style=\"margin: 0px; padding: 0px; color: #333333; font-family: Helvetica, Tahoma, Verdana, sans-serif; text-align: center;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: #333333; font-family: Helvetica, Tahoma, Verdana, sans-serif; text-align: center;\"><img title=\"RISE Concept\" src=\"http://lter.ro/storage/pages/January2020/Concept.png\" alt=\"\" /></p>\r\n<p style=\"margin: 0px; padding: 0px; color: #333333; font-family: Helvetica, Tahoma, Verdana, sans-serif; text-align: center;\">&nbsp;</p>',0,'2020-01-20 06:49:00','2020-01-22 05:32:09');
